import React from "react";
import { ThemeProvider, CssBaseline, Container } from "@mui/material";
import { motion } from "framer-motion";
import theme from "./theme";

// Component Imports
import Navbar from "./components/Navbar";
import CommandInput from "./components/CommandInput";
import FileUpload from "./components/FileUpload";
import LiveLatencyCard from "./components/LiveLatencyCard";
import SessionHistory from "./components/SessionHistory";
import Footer from "./components/Footer";
import ParticlesBackground from "./components/ParticlesBackground";

// Animation Variants
import { fadeInUp, containerFade } from "./motionVariants";

export default function App() {
  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <div className="relative min-h-screen bg-gradient-to-br from-slate-950 via-indigo-950 to-purple-900 text-white overflow-hidden">
        {/* Background */}
        <ParticlesBackground />

        {/* Motion Wrapper */}
        <motion.div
          variants={containerFade}
          initial="hidden"
          animate="visible"
          className="relative z-10 flex flex-col items-center justify-center pt-24 pb-12"
        >
          {/* Navbar */}
          <Navbar />

          {/* Header */}
          <motion.h1
            variants={fadeInUp}
            className="text-5xl sm:text-6xl font-extrabold text-transparent bg-clip-text bg-gradient-to-r from-cyan-400 to-violet-400 mt-6 mb-3"
          >
            Synaptra Core v3.0
          </motion.h1>

          <motion.p
            variants={fadeInUp}
            className="text-gray-400 max-w-2xl text-center mb-8"
          >
            Multimodal Embodied AI Agent â€“ bridging Vision, Audio, Reasoning & Action.
          </motion.p>

          {/* Main Section */}
          <Container
            maxWidth="md"
            className="bg-white/5 backdrop-blur-md rounded-2xl shadow-2xl border border-white/10 p-8"
          >
            <motion.div
              variants={fadeInUp}
              className="grid grid-cols-1 md:grid-cols-2 gap-6"
            >
              <FileUpload label="Image Input" />
              <FileUpload label="Audio Input" />
            </motion.div>

            <div className="mt-6">
              <CommandInput />
            </div>

            <div className="mt-6">
              <LiveLatencyCard />
            </div>

            <div className="mt-10">
              <SessionHistory />
            </div>
          </Container>

          {/* Footer */}
          <Footer />
        </motion.div>
      </div>
    </ThemeProvider>
  );
}
